bool IBasePlayer::IsValid()
{
	if (this == nullptr
		|| !this->IsPlayer()
		|| this->IsDormant()
		|| !this->isAlive()
		|| this == csgo->local
		|| this->GetTeam() == csgo->local->GetTeam())
		return false;

	return true;
}

